import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Records from "./Records";
import Menu from "./Menu";

function App() {
    return (
        <div>
            <Menu />
            <Header /><br/>
            <Records />
            <Footer />
        </div>
    );
}

export default App;
